from stores.Click.click_model import ClickStorefrom stores.Click.click_info import wacom_page_url, xp_pen_page_urldef start_click_wacom():    click = ClickStore(wacom_page_url)    items = click.generate_info()    return click.compare_data(items)def start_click_xp_pen():    click = ClickStore(xp_pen_page_url)    items = click.generate_info()    return click.compare_data_xp_pen(items)